import React from "react";
import './table.css'
function table(props) {
  const data = [
    {
       ma: "1",
       ten: " nguyen van A",
       luong:"10000000",
    }, {
       ma: "2",
       ten: " snguyen van Ap1",
       luong:"10000000",
    }, {
       ma: "3",
       ten: " sp1",
       luong:"10000000",
    }, {
       ma: "4",
       ten: " sp1",
       luong:"10000000",
    }, {
       ma: "5",
       ten: " sp1",
       luong:"10000000",
    }, {
       ma: "6",
       ten: " sp1",
       luong:"10000000",
    }, {
       ma: "7",
       ten: " sp1",
       luong:"10000000",
    }
  ]
  return (
    <table border={1}>
      <thead>
        <tr>
          <th>
            Mã
          </th>
          <th>
            Tên
          </th>
          <th>
            Tiền lương
          </th>
         </tr>
      </thead>
      <tbody>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{item.ma}</td>
            <td>{item.ten}</td>
            <td>{item.luong}</td>
          </tr>
        ))}
      </tbody>
    </table>);
}
export default table;
